const components = [];

const pipes = [MagicItemDisplayPipe];

@NgModule({
  declarations: [...components, ...pipes],
  imports: [CommonModule, SharedModule],
  exports: [...components, ...pipes],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
